import * as React from 'react';
import { ImageBackground, ScrollView, StyleSheet, Text, TextInput, TouchableOpacity, View } from 'react-native';

export default function LibrariesScreen({ navigation }) {
    return (
        <View style={styles.container}>
            <View style={styles.buttonContainer}>
                {/* Buttons */}
                <TouchableOpacity style={styles.button} onPress={() => handleCreatedButtonPress()}>
                    <Text style={styles.buttonText}>Created</Text>
                </TouchableOpacity>

                <TouchableOpacity style={styles.button} onPress={() => handleFavoriteButtonPress()}>
                    <Text style={styles.buttonText}>Favorite</Text>
                </TouchableOpacity>
            </View>

            {/* Your existing components go here */}
        </View>
    );
}

const styles = StyleSheet.create({
    container: {
        flexGrow: 1,
        backgroundColor: '#4F6F52',
        alignItems: 'center',
        justifyContent: 'flex-start',
        paddingTop: 40,
    },
    buttonContainer: {
        flexDirection: 'row',
        marginTop: 10, // Adjust as needed for spacing between buttons and other components
    },
    button: {
        backgroundColor: '#2978A0',
        paddingVertical: 15,
        paddingHorizontal: 30,
        borderRadius: 5,
        marginHorizontal: 10,
    },
    buttonText: {
        color: '#fff',
        fontSize: 18,
        fontWeight: 'bold',
    },
});
